public Identifier getParent() {
  Object obj = getInfo().get(PARENT_INFO_KEY);
  if (obj != null) {
    if (obj instanceof Identifier) {
      return (Identifier) obj;
    } else {
      throw new YarnRuntimeException(
          "Parent info is invalid identifier object");
    }
  }
  return null;
}

